import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 58.1-3255 General reassessment every four years not required in certain counties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-3255.md","filePath":"vacode/58.1-3255.md"}'),s={name:"vacode/58.1-3255.md"},n=t('<h1 id="§-58-1-3255-general-reassessment-every-four-years-not-required-in-certain-counties" tabindex="-1">§ 58.1-3255 General reassessment every four years not required in certain counties. <a class="header-anchor" href="#§-58-1-3255-general-reassessment-every-four-years-not-required-in-certain-counties" aria-label="Permalink to &quot;§ 58.1-3255 General reassessment every four years not required in certain counties.&quot;">​</a></h1><p>The governing body of any county which established a department of real estate assessments and provided for annual assessment and reassessment and equalization of assessments of real estate as provided in §§ <a href="http://law.lis.virginia.gov/vacode/15.2-716/" target="_blank" rel="noreferrer">15.2-716</a> and <a href="http://law.lis.virginia.gov/vacode/15.2-716.1/" target="_blank" rel="noreferrer">15.2-716.1</a> shall not be required to undertake general reassessments of real estate every four years as otherwise provided in this article.</p><p>Code 1950, § 58-784.5; 1973, c. 152; 1976, c. 717; 1984, c. 675; 2010, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0154" target="_blank" rel="noreferrer">154</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0199" target="_blank" rel="noreferrer">199</a>.</p>',3),o=[n];function i(c,l,d,_,f,u){return r(),a("div",null,o)}const v=e(s,[["render",i]]);export{p as __pageData,v as default};
